import PanelTemplate from "./PanelTemplate";
import { useLocation } from "react-router-dom";


function EmployeeList() {
    const navigate = useNavigate();
    const git = (page) => {
        navigate(`/manager${page}`)
    }

    return (
        <PanelTemplate
            title="Employee List"
            role="manager"
            rightContent={
                <h2></h2>
            }
        />
    );
}

export default EmployeeList;
